import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import AboutUs from './components/AboutUs/AboutUs';
import {Route, Redirect} from 'react-router-dom';
import CraftframeShop from './components/CraftframeShop/CraftframeShop';
import General from './components/General/General';
import Portfolio from './components/Portfolio/Portfolio';
import Price from './components/Price/Price';
import Reviews from './components/Reviews/Reviews';
import Discount from './components/Discount/Discount';
import LeaveARequest from './components/LeaveARequest/LeaveARequest';
import AddServices from './components/AddServices/AddServices';
import FeatureVideo from './components/FeatureVideo/FeatureVideo';
import ModelPhoto from './components/ModelPhoto/ModelPhoto';
import VisualManagerInst from './components/VisualManagerInst/VisualManagerInst';

function App() {
  return (
    <div className='App-wrapper'>
      <Header/>
      <Navbar/>
      <div className='App-wrapper-content'>
        <Route path='/aboutUs' render ={()=><AboutUs/>}/>
        <Route path='/craftframeShop' render ={()=><CraftframeShop/>}/>
        <Redirect from='/' to='/general'/>
        <Route path='/general' render={()=><General/>}/>
        <Route path='/portfolio' render={()=><Portfolio/>}/>
        <Route exact path='/price' render={()=><Price/>}/>
        <Route path='/reviews' render={()=><Reviews/>}/>
        <Route path='/discount' render={()=><Discount/>}/>
        <Route path='/leaveARequest' render={()=><LeaveARequest/>}/>
        <Route exact path='/price/addServices' render ={()=><AddServices/>}/>
        <Route exact path='/price/featureVideo' render ={()=><FeatureVideo/>}/>
        <Route exact path='/price/modelPhoto' render ={()=><ModelPhoto/>}/>
        <Route exact path='/price/visualManagerInst' render ={()=><VisualManagerInst/>}/>
      </div>
    </div>
  );
}

export default App;
